// Upsert attempts an insert using an executor, and does an update or ignore on conflict.
func (o *BasicTradeitem) Upsert(exec boil.Executor, updateColumns, insertColumns boil.Columns) error {
	if o == nil {
		return errors.New("models: no basic_tradeitems provided for upsert")
	}

	nzDefaults := queries.NonZeroDefaultSet(basicTradeitemColumnsWithDefault, o)

	// Build cache key in-line uglily - mysql vs psql problems
	buf := strmangle.GetBuffer()
	buf.WriteString(strconv.Itoa(updateColumns.Kind))
	for _, c := range updateColumns.Cols {
		buf.WriteString(c)
	}
	buf.WriteByte('.')
	buf.WriteString(strconv.Itoa(insertColumns.Kind))
	for _, c := range insertColumns.Cols {
		buf.WriteString(c)
	}
	buf.WriteByte('.')
	for _, c := range nzDefaults {
		buf.WriteString(c)
	}
	key := buf.String()
	strmangle.PutBuffer(buf)

	basicTradeitemUpsertCacheMut.RLock()
	cache, cached := basicTradeitemUpsertCache[key]
	basicTradeitemUpsertCacheMut.RUnlock()

	var err error

	if !cached {
		insert, ret := insertColumns.InsertColumnSet(
			basicTradeitemAllColumns,
			basicTradeitemColumnsWithDefault,
			basicTradeitemColumnsWithoutDefault,
			nzDefaults,
		)
		insert = strmangle.SetComplement(insert, basicTradeitemColumnsWithAuto)
		for i, v := range insert {
			if strmangle.ContainsAny(basicTradeitemPrimaryKeyColumns, v) && strmangle.ContainsAny(basicTradeitemColumnsWithDefault, v) {
				insert = append(insert[:i], insert[i+1:]...)
			}
		}
		if len(insert) == 0 {
			return errors.New("models: unable to upsert basic_tradeitems, could not build insert column list")
		}

		ret = strmangle.SetMerge(ret, basicTradeitemColumnsWithAuto)
		ret = strmangle.SetMerge(ret, basicTradeitemColumnsWithDefault)

		update := updateColumns.UpdateColumnSet(
			basicTradeitemAllColumns,
			basicTradeitemPrimaryKeyColumns,
		)
		update = strmangle.SetComplement(update, basicTradeitemColumnsWithAuto)

		if len(update) == 0 {
			return errors.New("models: unable to upsert basic_tradeitems, could not build update column list")
		}

		cache.query = buildUpsertQueryMSSQL(dialect, "basic_tradeitems", basicTradeitemPrimaryKeyColumns, update, insert, ret)

		whitelist := make([]string, len(basicTradeitemPrimaryKeyColumns))
		copy(whitelist, basicTradeitemPrimaryKeyColumns)
		whitelist = append(whitelist, update...)
		whitelist = append(whitelist, insert...)

		cache.valueMapping, err = queries.BindMapping(basicTradeitemType, basicTradeitemMapping, whitelist)
		if err != nil {
			return err
		}
		if len(ret) != 0 {
			cache.retMapping, err = queries.BindMapping(basicTradeitemType, basicTradeitemMapping, ret)
			if err != nil {
				return err
			}
		}
	}

	value := reflect.Indirect(reflect.ValueOf(o))
	vals := queries.ValuesFromMapping(value, cache.valueMapping)
	var returns []interface{}
	if len(cache.retMapping) != 0 {
		returns = queries.PtrsFromMapping(value, cache.retMapping)
	}

	if boil.DebugMode {
		fmt.Fprintln(boil.DebugWriter, cache.query)
		fmt.Fprintln(boil.DebugWriter, vals)
	}

	if len(cache.retMapping) != 0 {
		err = exec.QueryRow(cache.query, vals...).Scan(returns...)
		if err == sql.ErrNoRows {
			err = nil // MSSQL doesn't return anything when there's no update
		}
	} else {
		_, err = exec.Exec(cache.query, vals...)
	}
	if err != nil {
		return errors.Wrap(err, "models: unable to upsert basic_tradeitems")
	}

	if !cached {
		basicTradeitemUpsertCacheMut.Lock()
		basicTradeitemUpsertCache[key] = cache
		basicTradeitemUpsertCacheMut.Unlock()
	}

	return nil
}

